Here's your roadmap for the year!

Every class session has four important sections. You should read about
the details for each using the main menu at the top of this webpage.

-   [**Week Overview**](/weeks/index.html)
    (<i class="fas fa-binoculars"></i>): This page overviews the weeks

-   [**Lectures**](/lectures/index.html)
    (<i class="fas fa-chalkboard-teacher"></i>): This page is for
    lectures

-   [**Labs**](/labs/index.html) (<i class="fas fa-laptop-code"></i>):
    This page is about labs

-   [**Extras**](/Extras/index.html) (<i class="fas fa-gift"></i>): This
    page is about Extras

-   [**Coursework**](/coursework/index.html)
    (<i class="fas fa-pencil-ruler"></i>): This page contains the
    instructions for either the session exercise (1--3 brief tasks), or
    for the two mini projects and final project. **Assignments are due
    by 11:59 PM on the day they're listed.**

-   [**Mini-Diss**](/Mini-Diss/index.html)
    (<i class="fas fa-book-bookmark"></i>): This page contains an
    interactive lesson that teaches you the principles and code you need
    to know. Go through these after doing the content.

